import React from "react";

function Jumbotron({ children }) {
  return (
    <div
      style={{ backgroundColor: transpa, height: 500, clear: "both", paddingTop: 120, textAlign: "center" }}
      className="jumbotron"
    >
      {children}
      <h1>Google Book Search!</h1>
    </div>
  );
}

export default Jumbotron;
